// import Header from "./Header";
import SearchBar from "./SearchBar";
// import RestaurantContainer from "./RestaurantContainer";

function App() {

  const fetchFromUserLocation = (parameter1, parameter2) => {
    console.log(parameter1, parameter2)
    if (typeof parameter1 === "number" && typeof parameter2 === "number") {
    const BEARER_TOKEN = "3aTio_Vnt6LnEtPLXeighLJhAdc897oPsKJEWyy8wdOdLPYCODBJc8pA2RoR6BAFVfWzVXbW08njQGzGawtyNO0ORkuI09Fou_daCYndCjrQnFBZhD06Fr-OyS7TYXYx"
    useEffect(
      ()=>{
        fetch(`https://cors-anywhere.herokuapp.com/https://api.yelp.com/v3/businesses/search?term=delis&latitude=${parameter1}&longitude=${parameter2}`, {
        // fetch(`https://cors-anywhere.herokuapp.com/https://api.yelp.com/v3/businesses/search?term=delis&latitude=37.786882&longitude=-122.399972`, {
          method: "GET",
          headers: {
            Authorization: `Bearer ${BEARER_TOKEN}`,
            mode: "no-cors",
            'Access-Control-Allow-Origin': '*',
          }
        })
        .then(resp => resp.json())
        .then(data=>console.log(data))
      }, []
  )
  }
  }

  // console.log(lat,lng)
  return(
    <div>
      <SearchBar invDataFlow={fetchFromUserLocation} />
      {/* <Header /> */}
      {/* <RestaurantContainer />  */}
    </div>
  );
}
export default App;
